package com.example.usage;

import com.seed.simpleApi.SeedSimpleApiClient;

public class Example {
    public static void main(String[] args) {
        SeedSimpleApiClient client = SeedSimpleApiClient
            .builder()
            .token("<token>")
            .build();

        client.user().get("id");
    }
}

